export const host = "http://127.0.0.1:8000";

const apiURL = "/api";

const apiAuthUrl = "/api/auth";

export const endpoint = `${host}${apiURL}`;

export const endpointForAuth = `${host}${apiAuthUrl}`;

export const createStore = `${endpointForAuth}/createStore`;
